-- Table structure for m_state
-- ----------------------------
DROP TABLE IF EXISTS `m_state`;
CREATE TABLE `m_state` (
  `ID` varchar(40) NOT NULL,
  `AgentID` varchar(20) DEFAULT NULL COMMENT '坐席工号（如果当前分机上没有登录坐席，则此字段为空）',
  `Station` varchar(20) DEFAULT NULL COMMENT '分机号',
  `LogonTime` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `State` int(40) DEFAULT NULL COMMENT '分机状态类型：职场配置 -人员状态',
  `AUX_Code` varchar(10) DEFAULT NULL COMMENT '小休原因类型  职场配置 - 事忙原因',
  `Begintime` timestamp NULL DEFAULT NULL COMMENT '状态开始时间',
  `Pre_aux` varchar(10) DEFAULT NULL,
  `pre_state` varchar(10) DEFAULT NULL,
  `StateInfo` varchar(20) DEFAULT NULL,
  `CustPhone` varchar(20) DEFAULT NULL,
  `CallDirect` varchar(5) DEFAULT NULL COMMENT '备注',
  `Split` varchar(4000) DEFAULT NULL COMMENT '技能组。只针对呼入电话，',
  `CRT_DT` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

